import React, { useState,useEffect } from 'react'
import {
  CButton,
  CCard,
  CCardBody,
  CCardHeader,
  CCol,
  CContainer,
  CJumbotron,
  CRow,
  CEmbed,
  CDropdown,
  CDropdownToggle,
  CDropdownDivider,
  CDropdownHeader,
  CModal,
  CModalBody,
  CModalFooter,
  CModalHeader,
  CModalTitle,
  CDropdownItem,
  CDropdownMenu,
  CEmbedItem
} from '@coreui/react'
import { DocsLink } from 'src/reusable'
import BASE_URL from 'src/views/base'
import Cookies from 'universal-cookie';

const cookies = new Cookies();
console.log(cookies.get('gym_uuid'))


const Expenses = () => {


const [modal, setModal] = useState(false)
const [large, setLarge] = useState(false)
const [small, setSmall] = useState(false)
const [primary, setPrimary] = useState(false)
const [secondary,setsecondary] = useState(false)
const [Rulesuccess,setRulesuccess] =useState(false)
const [success, setSuccess] = useState(false)
const [warning, setWarning] = useState(false)
const [danger, setDanger] = useState(false)
const [info, setInfo] = useState(false)


const [getinstructor, setgetinstructor] = useState([])
const [getuser, setuser] = useState([])
const [getinstructordetail, setinstructordetail] = useState([])


const axios = require('axios');

useEffect(() => {
    axios
    .get(BASE_URL + 'payments/promocodes/')
    .then(res => {
        console.log(res)
        setgetinstructor(res.data)
    })
    .catch(err => {
        console.log(err)
    })
}, [])


useEffect(() => {
    axios
      .get(BASE_URL + 'payments/rulesets')
      .then(res => {
        console.log(res)
        setuser(res.data)
      })
      .catch(err => {
        console.log(err)
      })
  }, [])



  function Clicker(uuid) {
      // alert(uuid);
      setSuccess(!success);
      //  debugger
      axios
        .get(BASE_URL + 'gymprofile/instructor/' + uuid)
        .then(getuuid => {
          console.log(getuuid);
          setinstructordetail(getuuid.data);
        })

    }

    function Clicker2(uuid) {
        // alert(uuid);
        setRulesuccess(!Rulesuccess);
        //  debugger
        axios
          .get(BASE_URL + 'gymprofile/instructor/' + uuid)
          .then(getuuid => {
            console.log(getuuid);
            setinstructordetail(getuuid.data);
          })

      }


async function NewPromocode() {
    // setSuccess(false);

     debugger
    var code = document.getElementById('code').value;
    var discount = document.getElementById('discount').value;
    var start_date = document.getElementById('start_date').value;
    var end_date = document.getElementById('end_date').value;
    var max_usage = document.getElementById('max_usage').value;
    var ruleset = document.getElementById('ruleset').value;  

    {  
        console.log('Trying to send request');

        try {
            let loader = `<div><div class="loader centered"/></div>`;
            // document.getElementById('reg').innerHTML = loader;
            console.log('Trying');
            let res = await axios.post(BASE_URL + 'payments/promocodes/', {
                code:code,
                discount:discount,
                start_date:start_date,
                end_date:end_date,
                max_usage:max_usage,
                ruleset:ruleset,          
            });
            if (res.status === 201) {
                //  debugger

                console.log(res.status);
                console.log(res.data);

                window.location.reload();


            }
            //  debugger

            return res.data
        }
        catch (err) {
            console.error('Signup Failed , Please try again.');
            window.location.reload();
            alert(err);
        }
    }
